            inv.total,
            inv.subtotal as invoice_subtotal,
            c.company as client_name,
            c.userid as mrd_no,
            au.firstname,
            au.lastname,
            ii.id as item_id,
            ii.description,
            ii.long_description,
            (SELECT MAX(date) FROM tblinvoicepaymentrecords WHERE invoiceid = inv.id) as last_payment_date,
            (SELECT SUM(amount) FROM tblinvoicepaymentrecords WHERE invoiceid = inv.id) as total_paid,
            cur.name as currency_name
        FROM tblinvoices as inv
        LEFT JOIN tblclients as c ON c.userid = inv.clientid
        LEFT JOIN tblaffiliate_users as au ON au.affiliate_code = c.affiliate_code COLLATE utf8mb4_unicode_ci
        LEFT JOIN tblcurrencies as cur ON cur.id = inv.currency
        LEFT JOIN tblitemable as ii ON ii.rel_id = inv.id AND ii.rel_type = 'invoice'
        WHERE 1=1 AND (inv.total - IFNULL((SELECT SUM(amount) FROM tblinvoicepaymentrecords WHERE invoiceid = inv.id), 0)) = 0
        ORDER BY inv.id ASC, ii.id ASC
     
